INSERT INTO `book` VALUES ('47', '聪明的投资者', '9787115253699', 'Z123/124', '[美] 本杰明·格雷厄姆', '人民邮电出版社', '', '本书首先明确了“投资”与“投机”的区别，指出聪明的投资者当如何确定预期收益。本书着重介绍防御型投资者与积极型投资者的投资组合策略，论述了投资者如何应对市场波动。本书还对基金投资、投资者与投资顾问的关系、普通投资者证券分析的一般方法、防御型投资者与积极型投资者的证券选择、可转换证券及认股权证等问题进行了详细阐述。在本书后面，作者列举分析了几组案例，论述了股息政策，最后着重分析了作为投资中心思想的“安全性”问题。本书主要面向个人投资者，旨在对普通人在投资策略的选择和执行方面提供相应的指导。本书不是一本教人“如何成为百万富翁”的书籍，而更多地将注意力集中在投资的原理和投资者的态度方面，指导投资者避免陷入一些经常性的错误之中。', '2019-03-29 11:02:44', '2019-03-29 11:02:44', 'F0', '1', '1');
INSERT INTO `book` VALUES ('48', '从0到1', '9787508649719', 'Z123/123', '彼得·蒂尔 / 布莱克·马斯特斯', '中信出版股份有限公司', '', '硅谷创投教父、PayPal创始人作品，斯坦福大学改变未来的一堂课，为世界创造价值的商业哲学。\r\n\r\n在科技剧烈改变世界的今天，想要成功，你必须在一切发生之前研究结局。\r\n\r\n你必须找到创新的独特方式，让未来不仅仅与众不同，而且更加美好。\r\n\r\n从0到1，为自己创造无限的机会与价值！\r\n\r\nPaypal创始人、Facebook第一位外部投资者彼得•蒂尔在本书中详细阐述了自己的创业历程与心得，包括如何避免竞争、如何进行垄断、如何发现新的市场。《从0到1》还将带你穿越哲学、历史、经济等多元领域，解读世界运行的脉络，分享商业与未来发展的逻辑，帮助你思考从0到1的秘密，在意想不到之处发现价值与机会。\r\n\r\n揭开创新的秘密，进入彼得•蒂尔颠覆式的商业世界：\r\n\r\n创新不是从1到N，而是从0到1\r\n\r\n全球化并不全是进步\r\n\r\n竞争扼杀创新\r\n\r\n“产品会说话”是谎言\r\n\r\n失败者才去竞争，创业者应当选择垄断\r\n\r\n创业开局十分重要，“频繁试错”是错误的\r\n\r\n没有科技公司可以仅靠品牌吃饭\r\n\r\n初创公司要打造帮派文化', '2019-01-14 09:15:54', '2019-01-14 09:15:54', 'A1', '1', '1');
INSERT INTO `book` VALUES ('64', '一课经济学', '9787508650753', 'Z123/123', '[美] H·黑兹利特', '中信出版社', '', '本书是美国著名经济专栏作家亨利·黑兹利特专为社会大众撰写的经济学入门读物。全书包括三大部分26章，以一堂课的形式，深入浅出地讨论了涉及现实社会经济生活的诸多问题，例如公共建设工程、税收、政府信贷、就业与失业、关税、最低工资、进出口、价格体系、房租管制、工会、最低工资、利润、储蓄、通货膨胀等，以最简单的阐述方式，向读者逐次解读这些复杂的经济问题背后的真相、什么样的经济政策会造成什么样的结果。', '2019-01-14 14:01:41', '2019-01-14 14:01:41', 'F22', '1', '1');
INSERT INTO `book` VALUES ('65', '反脆弱', '9787508643335', 'Z123/123', '[美] 纳西姆·尼古拉斯·塔勒布 / [美] 纳西姆·塔勒布', '中信出版社', '', '为什么这个世界上最稳定的国家其实没有政府？\r\n\r\n为什么负债对你不好，以及为什么我们通常所说的“效率”根本缺乏就是效率？\r\n\r\n为什么政府和社会政策保护强者，却伤害弱者？\r\n\r\n为什么你应该在还没入职之前，就应该写好辞职信？\r\n\r\n泰坦尼克号的沉没为什么拯救了更多的生命？\r\n\r\n尼采有句名言：“杀不死我的，使我更强大。”就像人的骨头承受压力和紧张会变得更加强壮，谣言或暴乱在有人试图压制它们时会变本加厉一样，生命中的许多事物也会受益于压力、混乱、波动和不确定。\r\n\r\n畅销书《黑天鹅》告诉我们，发生概率极低的事件和无法预测的“黑天鹅”事件，在世界上几乎每一种事物的身上都会发生。在《反脆弱》一书中，塔勒布告诉我们在不确定的世界中的生存法则，他找到并定义了“反脆弱”类事物：每一个事物都会从波动中得到利益或蒙受损失，脆弱性是指因为波动和不确定而承受损失，反脆弱性则是指让自己避免这些损失，甚至从混乱和不确定中获利。\r\n\r\n反脆弱类事物不只受益于混沌，也需要适时出现的压力与危机，如此才能维持生存与实现繁荣。作者还认为，不确定性是件好事，甚至有其存在的必要，并且建议我们培养反脆弱性的特质。反脆弱性超越强韧性或坚固性：强韧性只能够抵抗震动和维持原状；反脆弱性则会让事物变得越来越好。此外，反脆弱性还可以避免预测误差，并且保护事物不受负面“黑天鹅”事件的影响。\r\n\r\n这本书大谈试错法、人生的大小决定、政治、自治市、战争、个人理财、经济体系和医疗系统……风格独树一帜。《反脆弱》性是我们生活在不确定世界中的“导航仪”，也是面对随时可能出现的“黑天鹅”事件的终极自保指南。', '2019-01-14 14:03:22', '2019-01-14 14:03:22', 'C91', '1', '1');
INSERT INTO `book` VALUES ('66', '活法', '9787506045025', 'Z123/123', '[日] 稻盛和夫', '东方出版社', '', '做企业的目的是什么？赢利！做企业人的目标是什么？帮企业赢利！然而，为什么在财务报表形势喜人、经营业绩节节攀升的同时，我们还会听到公司员工对老板的私下抱怨，看到高层们面对发展的十字路口无法舒展的愁眉，甚至此时正目睹着各界舆论对业界翘楚、时代精英们毫不留情、铺天盖地的指责与奚落？ 诚然，所有企业及企业人都恪守着赢利——这一亘古不变的原则在时代的浪潮中奋勇前进，但是又有多少人真正参透了利益背后的玄机？中国并不需要“道义放两边、利字摆中间”的商业大鳄，更不会提供给缺乏德行、忽视修为的企业人广阔发展的康庄大道；如果想在白热化的竞争中一枝独秀，就必须要剖开经济的表象，探求企业的本质，找到得以在如今的世道中生存下去的活法。 这本《活法》的作者稻盛和夫是日本战后经济的传奇，他不用优美的文字取胜，也不用高深的说教让人五体投地，而是将其多年心得以质朴的文字向我们娓娓道来。企业人会从中领会真正的企业发展之路，而普通人亦将感受到最高境界的“为人之道”。 《活法》适合大众阅读。', '2019-01-14 14:04:43', '2019-01-14 14:04:43', 'B0', '1', '1');
INSERT INTO `book` VALUES ('67', '断舍离', '9787505734746', 'Z123/123', '[日] 山下英子', '中国友谊出版公司', '', '◎不可思议的懒人整理术，超人气日式收纳最高哲学。\r\n\r\n2015年，山下英子女士推出“断舍离”白金升级实操版。在本书中首度明确提出30种整理术和舍弃法，涵盖“时间、人生、生活”，被媒体誉为“不可思议的懒人整理术，超人气日式收纳最高哲学”。从此“断舍离“不再是概念，更是一种生活方式。\r\n\r\n◎“断”是一种勇敢。它让你丢掉懦弱、胆小的自己，成为一个敢于面对自我的勇士。\r\n\r\n“舍”是一种决断。它让你戒掉依赖他人、习惯拖延的坏习惯，成就清爽高效的人生。\r\n\r\n“离”是一种温柔。它让你与过去一刀两断后，更加珍惜这个世界被你留下的人与物。\r\n\r\n◎如果你有以下困惑，本书为你量身定做——\r\n\r\n1、感觉不到家的温馨与舒适？\r\n\r\n2、房间杂乱却不知该如何下手？\r\n\r\n3、怎么也改不掉拖延症？\r\n\r\n4、无数次冲动购物的受害者？\r\n\r\n5、莫名奇妙的安全感缺失？\r\n\r\n6、越整理越陷入到无穷的焦虑？\r\n\r\n7、总是无法完成计划陷入死循环的沮丧？', '2019-01-14 14:05:55', '2019-01-14 14:05:55', 'B3', '1', '1');
INSERT INTO `book` VALUES ('68', '正念的奇迹', '9787511701145', 'Z123/123', '[法] 一行禅师', '中央编译出版社', '', '目录：\r\n\r\n序言一　这本书本身就是奇迹\r\n\r\n序言二　一行禅师:以慈悲之眼观照\r\n\r\n第一章　日常生活中的正念\r\n\r\n第二章　奇迹就是在大地上行走\r\n\r\n第三章　正念日\r\n\r\n第四章　鹅卵石\r\n\r\n第五章　一即一切,一切即一:五蕴\r\n\r\n第六章　你庭前的杏树\r\n\r\n第七章　三个绝妙的答案\r\n\r\n第八章　32个正念的练习\r\n\r\n附录　佛经选读', '2019-01-14 14:07:17', '2019-01-14 14:07:17', 'B5', '1', '1');
INSERT INTO `book` VALUES ('69', '公正', '9787508625874', 'Z123/123', '[美] 迈克尔·桑德尔', '中信出版社', '', '当我们遇到生死抉择的时候，为什么我们常常违背利益最大化的原则而尊重人的基本权利？可是，当我们口口声声说生命至上时，为什么像福特汽车这样的企业却会给生命贴上价格标签？如果我们尊重个体的权利，但为什么大多数人又会反对同性恋婚姻？我们认为法律必须保护合同的有效性，但为什么一些双方自愿签订的合同却被法院推翻？\r\n\r\n我们的社会、我们的思潮、我们的正义观，正陷入尴尬的两难选择当中。我们甚至怀疑法律是否是公正的，因为法律无法回避个人的道德判断，无法做到中立性。我们能否找到另外一条道路，让我们的社会规范即体现人性，又体现客观性？“世界最受欢迎的老师之一”的迈克尔•桑德尔教授寻找的，正是我们期待的有关公正的第三条路径：培养我们每个人的德性，做出有道德的选择。', '2019-01-14 14:09:40', '2019-01-14 14:09:40', 'B82', '1', '1');
INSERT INTO `book` VALUES ('70', '活着', '9787544210966', 'Z123/123', '余华', '南海出版公司', '', '地主少爷福贵嗜赌成性，终于赌光了家业一贫如洗，穷困之中的福贵因为母亲生病前去求医，没想到半路上被国民党部队抓了壮丁，后被解放军所俘虏，回到家乡他才知道母亲已经去世，妻子家珍含辛茹苦带大了一双儿女，但女儿不幸变成了聋哑人，儿子机灵活泼……\r\n\r\n然而，真正的悲剧从此才开始渐次上演，每读一页，都让我们止不住泪湿双眼，因为生命里难得的温情将被一次次死亡撕扯得粉碎，只剩得老了的福贵伴随着一头老牛在阳光下回忆。', '2019-01-14 14:17:58', '2019-01-14 14:17:58', 'C0', '1', '1');
INSERT INTO `book` VALUES ('71', '围城', '9787020024759', 'Z123/123', '钱钟书', '人民文学出版社', '', '《围城》是钱钟书所著的长篇小说。第一版于1947年由上海晨光出版公司出版。1949年之后，由于政治等方面的原因，本书长期无法在中国大陆和台湾重印，仅在香港出现过盗印本。1980年由作者重新修订之后，在中国大陆地区由人民文学出版社刊印。此后作者又曾小幅修改过几次。《围城》 自从出版以来，就受到许多人的推崇。由于1949年后长期无法重印，这本书逐渐淡出人们的视野。1960年代，旅美汉学家夏志清在《中国现代小说史》(A History of Modern Chinese Fiction)中对本书作出很高的评价，这才重新引起人们对它的关注。人们对它的评价一般集中在两方面，幽默的语言和对生活深刻的观察。从1990年代开始，也有人提出对本书的不同看法，认为这是一部被“拔高”的小说，并不是一部出色的作品。很多人认为这是一部幽默作品。除了各具特色的人物语言之外，作者夹叙其间的文字也显着机智与幽默。这是本书的一大特色。也有人认为这是作者卖弄文字，语言显得尖酸刻薄。但这一说法并不为大多数人接受。', '2019-01-14 14:19:12', '2019-01-14 14:19:12', 'C0', '1', '1');
INSERT INTO `book` VALUES ('72', '平凡的世界', '9787020049295', 'Z123/1234', '路遥', '人民文学出版社', '', '《平凡的世界》是一部现实主义小说，也是一部小说形式的家族史。作者浓缩了中国西北农村的历史变迁过程，在小说中全景式地表现了中国当代城乡的社会生活。在近十年的广阔背景下，通过复杂的矛盾纠葛，刻划社会各阶层众多普通人的形象。劳动与爱情，挫折与追求，痛苦与欢乐，日常生活与巨大社会冲突，纷繁地交织在一起，深刻地展示了普通人在大时代历史进程中所走过的艰难曲折的道路。', '2019-01-14 14:20:31', '2019-01-14 14:20:31', 'C0', '1', '1');
INSERT INTO `book` VALUES ('73', '倾城之恋', '9787536023918', 'Z123/123', '张爱玲', '花城出版社', '', '一对现实庸俗的男女，在战争的兵荒马乱之中被命运掷骰子般地掷到了一起，于“一刹那”体会到了“一对平凡的夫妻”之间的“一点真心”⋯⋯张爱玲是作为中国现代文学史上的一位杰出作家，而不是作为一个怪人、异人而存在的。也许她将不仅仅属于现代文学史。遥想几十年、几百年后，她会像她欣赏的李清照一样，在整个中国文学史上占据一个稳定的位置也说不定，而我们知道，那时候今天为我们所熟知的许多现代作家肯定都将被忽略不计了。', '2019-01-14 14:21:42', '2019-01-14 14:21:42', 'C0', '1', '1');
INSERT INTO `book` VALUES ('74', '边城', '9787537823425', 'Z123/123', '沈从文 / 黄永玉 / 绘者 卓雅', '北岳文艺出版社', '', '《边城》是沈从文的代表作，写于一九三三年至一九三四年初。这篇作品如沈从文的其他湘西作品，着眼于普通人、善良人的命运变迁，描摹了湘女翠翠阴差阳错的生活悲剧，诚如作者所言：“一切充满了善，然而到处是不凑巧。既然是不凑巧，因之素朴的善终难免产生悲剧。”\r\n\r\n《边城》写出了一种如梦似幻之美，像摆渡、教子、救人、助人、送葬这些日常小事，在作者来都显得相当理想化，颇有几分“君子田”的气象。当然，矛盾也并非不存在，明眼人一看便知，作者所用的背景材料中便隐伏着社会矛盾的影子。作者亦不曾讳言他的写作意图是支持“民族复兴大业的人”，“给他们一种勇气和信心”。', '2019-01-14 14:22:53', '2019-01-14 14:22:53', 'C0', '1', '1');
INSERT INTO `book` VALUES ('75', '皮囊', '9787201088945', 'Z123/123', '蔡崇达', '天津人民出版社', '', '一部有着小说阅读质感的散文集，也是一本“认心又认人”的书。\r\n\r\n作者蔡崇达，本着对故乡亲人的情感，用一种客观、细致、冷静的方式，讲述了一系列刻在骨肉间故事。一个福建渔业小镇上的风土人情和时代变迁，在这些温情而又残酷的故事中一一体现。用《皮囊》这个具有指向本质意味的书名，来 表达作者对父母、家乡的缅怀，对朋友命运的关切，同时也回答那些我们始终要回答的问题。\r\n\r\n书中收录有《皮囊》《母亲的房子》《残疾》《重症病房里的圣诞节》《我的神明朋友》《张美丽》《阿小和阿小》《天才文展》《厚朴》《海是藏不住的》《愿每个城市都不被阉割》《我们始终要回答的问题》《回家》《火车伊要开往叨位》等14篇作品。\r\n\r\n其中《皮囊》一文中的阿太，一位99岁的老太太，没文化，是个神婆。她却教给作者具有启示力量的生活态度：“肉体是拿来用的，不是拿来伺候的。”\r\n\r\n《母亲的房子》里，母亲想要建一座房子，一座四楼的房子，因为“这附近没有人建到四楼，我们建到了，就真的站起来了”。为了房子，她做苦工，捡菜叶，拒绝所有人的同情，哪怕明知这座房子不久后会被拆毁，只是为了“这一辈子，都有家可归”。\r\n\r\n而《残疾》里的父亲，他离家、归来，他病了，他挣扎着，全力争取尊严，然后失败，退生为孩童，最后离去。父亲被照亮了。被怀着厌弃、爱、不忍和怜惜和挂念，艰难地照亮。就在这个过程中，作者长大成人。自70后起，在文学书写中，父亲形象就失踪了。而蔡崇达的书里，这个形象重新出现了。\r\n\r\n这部特别的“新人新作”，由韩寒监制，上市之初即广受好评。莫言、白岩松、阿来、阎连科等评价为当下写作中的一个惊喜。或许《皮囊》真是新生的＂非虚构＂写作林地里，兀自展现的一片完全与众不同、可读可思、独具样貌的林木。', '2019-01-14 14:40:46', '2019-01-14 14:40:46', 'B0', '1', '1');
INSERT INTO `book` VALUES ('76', '芳华', '9787020123728', 'Z123/123', '严歌苓', '人民文学出版社', '', '从军经历伴随了严歌苓整个的青春年华。当她后来成为了一个作家，这段经历成了她取之不竭的创作源泉。《一个女兵的悄悄话》《雌性的草地》《灰舞鞋》《白麻雀》《爱犬颗勒》，都以部队生活为题材，但多是以一个作家的客观视角来为那个时代的军人塑像。而她*创作的长篇小说《芳华》则具有浓厚的个人自传色彩，是以*人称描写她当年亲历的部队文工团生活：隐藏在西南部都城的一座旧红楼里、某部队文工团的内景中发生的军版“才子佳人”的故事。\r\n\r\n《芳华》涵盖了严歌苓的青春与成长期，她在四十余年后回望这段经历，笔端蕴含了饱满的情感。青春荷尔蒙冲动下的少男少女的懵懂激情，由激情犯下的过错，由过错生出的懊悔，还有那个特殊的时代背景，种种，构成了《芳华》对一段历史、一群人以及潮流更替、境遇变迁的复杂感怀。今天的作者严歌苓与当时的小女兵萧穗子在作品里构成了理性与感性的对话关系，重新呈现了当时年代里青春的混沌、感性与蒙昧。生命的恣肆与人性的层次以及时代的的特征构成了《芳华》繁复的调性，它向读者打开了多层面的认识路径。', '2019-01-14 15:19:48', '2019-01-14 15:19:48', 'A1', '1', '1');
INSERT INTO `book` VALUES ('77', '人生的枷锁', '9787532741731', 'Z123/123', '[英] 威廉·萨默塞特·毛姆', '上海译文出版社', '', '《人生的枷锁》是毛姆的代表作，具有明显的自传色彩。\r\n\r\n小说主人公菲利普·凯里自幼父母双亡，不幸又先天残疾，在冷漠而陌生的环境中度过了童年，性格因此孤僻而敏感。在寄宿学校度过的岁月让他饱受了不合理的学校制度的摧残，而当他走入社会后，又在爱情上经历了伤痛。在坎坷的人生道路上，他每跨一步，都要付出艰辛的挣扎，但思想和个性都独立不羁的凯里，一直努力挣脱宗教和小市民意识这两条禁锢自己精神的桎梏，力图在混沌纷扰的生活漩流中，寻求人生的真谛。', '2019-01-18 09:43:15', '2019-01-18 09:43:15', 'Z1', '1', '1');
INSERT INTO `book` VALUES ('78', '你一生的故事', '9787544752473', 'Z123/123', '[美] 特德·姜', '译林出版社', '', '一瞥之下，过去与未来轰轰然同时并至，\r\n\r\n我的意识成为长达半个世纪的灰烬，时间未至已成灰。\r\n\r\n五十年诸般纷纭并发眼底，我的余生尽在其中。\r\n\r\n还有，你的一生。\r\n\r\n《你一生的故事》结集特德·姜早期的七篇作品：代表作《你一生的故事》、处女作《巴比伦塔》以及《领悟》、《除以零》、《七十二个字母 》、《人类科学之演变》、《地狱是上帝不在的地方》——\r\n\r\n一个语言学家学会了一门外星语言，彻底改变了她的世界观。过去、现在、未来，在她眼前同时展开。\r\n\r\n为了离上帝更近，人类伐木烧砖，拉车砌塔，经过无数个世代的辛劳，终于建成一座巍峨耸立于天地之间的通天塔。\r\n\r\n只要一小瓶药水，就能拥有超人智慧，这个诱惑无人能挡。可惜超人不止一个，荡气回肠的超人对决之后，领悟终极的智慧。\r\n\r\n任何数字除以零，都不会得出一个有意义的结果。两个人的感情除以零，结果是什么？\r\n\r\n在一个“名字驱动一切”的世界，命名师们玩转七十二个字母，寻找人类种族繁衍的密码。\r\n\r\n当人类的所有科学研究仅仅局限在解读后人类的科研成果时，这种研究是否还有存在的必要？\r\n\r\n妻子在天使下凡时去世，丈夫却必须学习如何热爱上帝，以便死后与妻子团聚', '2019-01-18 09:44:34', '2019-01-18 09:44:34', 'Z4', '1', '1');
INSERT INTO `book` VALUES ('79', '方向', '9787550290358', 'Z123/123', '[法] 马克-安托万·马修', '后浪丨北京联合出版公司', '', '一个无名的人在一片空茫茫的世界里跟随箭头前进、前进……他要去哪里？不知道。意义是什么？不知道。\r\n\r\n好了，面对这样一本奇书，每一个字的介绍都是多余的。聪明的你，跟紧了→\r\n\r\n...................', '2019-01-18 09:47:11', '2019-01-18 09:47:11', 'Z4', '1', '1');
INSERT INTO `book` VALUES ('80', '自然科学的哲学', '9787300076805', 'Z123/123', '[美]卡尔·G·亨普尔', '中国人民大学出版社', '', '本书是20世纪著名科学哲学家亨普尔的主要著作之一。它对当代科学哲学和科学方法论的最主要问题，例如科学的发现和假说的检验问题、科学定律和科学理论的性质问题、科学解释的结构及其功能问题、科学概念的形成和科学理论的还原问题等，都作了极为深入、极为严格又极为简明的论证。对于所有这些问题作者都从科学史上挑选了最为恰当、最为典型又最为生动的案例来加以通俗的解说。因此，它作为一本引人入胜的科学哲学教材在世界各国广为流行，在世界上已有十几种文字的翻译版本。', '2019-01-18 09:52:26', '2019-01-18 09:52:26', 'N0', '1', '1');
INSERT INTO `book` VALUES ('81', '河童', '9787532767106', 'Z123/123', '芥川龙之介', '上海译文出版社', '', '首个《河童》单行本\r\n\r\n芥川龙之介遗世之作\r\n\r\n20世纪日本文学经典\r\n\r\n《罗生门》表现了一个东方而古典的芥川龙之介，而《河童》展示了一个引领20世纪亚洲现代文学的现代派、先锋派的芥川龙之介。\r\n\r\n本书收录芥川的短篇小说共6篇。\r\n\r\n《河童》通过精神病院23号患者的自述，讲述了一段与人类社会既相悖又相似的河童国里的见闻与经历。虽然假托了一个虚构的世界，但贯穿全篇的机警的讽刺和犀利的批判处处指向现实，反而比当时很多现实主义作品都更准确也更生动地刻画出了20世纪20年代日本社会真实而本质的一面。\r\n\r\n在河童国内，所有观念都在嘲讽着现实社会中的人们，它们了解人类胜过了解自己。一旦掌握了它们特有的语言，接受了它们的怪异思想，离开了这个乌托邦之后，便会立刻陷入对人类产生无比嫌恶的烦恼之中。故事主人公好不容易才返回人世间，但由于已经无法习惯人类的生活，被当成了疯子。', '2019-01-18 09:58:19', '2019-01-18 09:58:19', 'I24', '1', '1');
INSERT INTO `book` VALUES ('82', '马来群岛自然科学考察记', '9787300059860', 'Z123/123', '（英）阿尔弗莱德・拉塞尔・华莱士', '中国人民大学出版社', '', '博物学是一门古老的学科。博物学传统与数理传统自古希腊以来就并称为科学的两大传统。但是与能够直接产生新技术、创造新价值的数理传统科学相比，意在观察自然、描述自然、感知自然的博物学传统科学，没有受到应有的重视。生活在都市丛林中的人们也与真正的自然疏离了。这套“西方文化大众精品书系”中推出的《马来群岛自然科学考察记》和即将推出的《乘小猎犬号环球航行》就是两部经典的博物学著作，其作者达尔文和华莱士是两位伟大的博物学家，他们为椎动科学发展做出了很大贡献。在书中，你可以跟随他们一起探索自然的奥秘；合上书本，去留心身边的花草、树木和可爱的小动物，你就会发现自然之美，体味到自然之趣。从1854年至1862年，华菜士用八年时间游历了马来群岛的各个岛屿，行程约一万四千英里，共采集了十二余万件生物标本。这些收集品为他提供了丰富的研究材料，由此他提出了自然选择理论。同时，他还对该地区的动物分布提出了一个基本理论――马来半岛的动物区可以划分为两部分，东为印度一马来区，西为澳洲一马来区――这一理论至今仍为科学界所接受。为了纪念他，科学界将划分这两个区域的界线称为“华莱土线”。 本书正是华莱士这次具有历史意义的旅行的全面记录。作者在书中为读者描绘了马来群岛施旋绚丽的自然风光，向读者介绍了马来群岛丰富多彩的新奇物种，让读者体验了马来群岛原始朴素的风土人情。更可贵的是，他在全书最后还预言了人类的现代文明对自然生态及人类自身的种种负面影响，读来十分发人深省。', '2019-01-18 09:59:05', '2019-01-18 09:59:05', 'N0', '1', '1');
INSERT INTO `book` VALUES ('83', '自然科学问题的数学分析', '9787040345247', 'Z123/123', 'B.A.卓里奇', '高等教育出版社', '', '《自然科学问题的数学分析》是卓里奇教授最新出版的一本极具特色的教学用书，内容包括三个专题：\r\n\r\n量纲分析及其应用（包括柯尔莫戈洛夫湍流模型）\r\n\r\n自变量极多的函数和集聚现象，非线性大数定律，高斯分布和麦克斯韦分布的几何意义，柯捷利尼科夫-香农定理；\r\n\r\n经典热力学和接触几何学，用微分形式语言表达的热力学定律，分布和弗罗贝尼乌斯定理，卡诺-卡拉泰奥多里距离。\r\n\r\n全书着重分析了从物理问题的研究中怎样提出数学问题，以及数学理论和结果有怎样的物理意义，很值得关心提高学生分析问题和解决问题能力的大学数学教师参考，有益于开阔大学数学分析教材改革的思路。\r\n\r\n《自然科学问题的数学分析》可供高等院校数学、物理及有关专业的教师和学生参考。', '2019-01-18 10:00:26', '2019-01-18 10:00:26', 'N0', '1', '1');
INSERT INTO `book` VALUES ('84', '行为社会科学基本问题', '9787208143395', 'Z123/123', '汪丁丁', '世纪文景／上海人民出版社', null, '社会选择何种制度更有利于社会发展？\r\n\r\n从现阶段的熟人社会到实现民主化政治，社会科学需要解决哪些基本问题？\r\n\r\n脑成像和基因检测技术的普及如何塑造社会科学的“真正感”？\r\n最具思想史视野的中国经济学家，广大青年学子的精神导师，跨学科教育的身体力行者——汪丁丁最新力作\r\n\r\n追踪国际最前沿研究成果，求解中国社会基本问题，尽显渊博之魅思想之力\r\n汪丁丁教授对于学术和思想的演化方向有约十年的预见能力。有感于十几年来社会科学的全部领域正被“脑科学化”，学界对这一整合趋势却无动于衷，他将常年追踪脑科学和遗传学前沿成果之所得凝聚于本书中，从行为学视角应对社会科学的核心议题，尝试解决国人外在生活方式与内在情感方式的冲突。\r\n\r\n激情、理性、自我、社会、影响力、不确定性、复杂性……论述依序围绕这些核心观念展开，探究有能力解释大规模社会变迁的“大理论”，并探索超越科学与人文的“第三种叙事”，以突破精英失灵的困境。', '2019-01-18 10:04:15', '2019-01-18 10:04:15', 'C0', '1', '1');
INSERT INTO `book` VALUES ('85', '共产党宣言', '9787010006727', 'Z123/123', '马克思 / 恩格斯', '人民出版社', '', '《共产党宣言》是马克思和恩格斯为共产主义者同盟起草的纲领，全文贯穿马克思主义的历史观，马克思主义诞生的重要标志。由马克思执笔写成 。1848年2月21日在伦敦第一次以单行本问世。2月24日，《共产党宣言》正式出版。', '2019-01-18 10:06:43', '2019-01-18 10:06:43', 'A1', '1', '1');
INSERT INTO `book` VALUES ('86', '算法导论', '9787111187776', 'T3/234', '[美] Thomas H.Cormen / Charles E.Leiserson / Ronald L.Rivest / Clifford Stein', '机械工业出版社', '', '这本书深入浅出，全面地介绍了计算机算法。对每一个算法的分析既易于理解又十分有趣，并保持了数学严谨性。本书的设计目标全面，适用于多种用途。涵盖的内容有：算法在计算中的作用，概率分析和随机算法的介绍。书中专门讨论了线性规划，介绍了动态规划的两个应用，随机化和线性规划技术的近似算法等，还有有关递归求解、快速排序中用到的划分方法与期望线性时间顺序统计算法，以及对贪心算法元素的讨论。此书还介绍了对强连通子图算法正确性的证明，对哈密顿回路和子集求和问题的NP完全性的证明等内容。全书提供了900多个练习题和思考题以及叙述较为详细的实例研究。', '2019-01-18 10:07:31', '2019-01-18 10:07:31', 'TP3', '1', '1');
INSERT INTO `book` VALUES ('87', '机器学习实战', '9787115317957', 'T3/235', 'Peter Harrington', '人民邮电出版社', null, '机器学习是人工智能研究领域中一个极其重要的研究方向，在现今的大数据时代背景下，捕获数据并从中萃取有价值的信息或模式，成为各行业求生存、谋发展的决定性手段，这使得这一过去为分析师和数学家所专属的研究领域越来越为人们所瞩目。\r\n\r\n本书第一部分主要介绍机器学习基础，以及如何利用算法进行分类，并逐步介绍了多种经典的监督学习算法，如k近邻算法、朴素贝叶斯算法、Logistic回归算法、支持向量机、AdaBoost集成方法、基于树的回归算法和分类回归树（CART）算法等。第三部分则重点介绍无监督学习及其一些主要算法：k均值聚类算法、Apriori算法、FP-Growth算法。第四部分介绍了机器学习算法的一些附属工具。\r\n\r\n全书通过精心编排的实例，切入日常工作任务，摒弃学术化语言，利用高效的可复用Python代码来阐释如何处理统计数据，进行数据分析及可视化。通过各种实例，读者可从中学会机器学习的核心算法，并能将其运用于一些策略性任务中，如分类、预测、推荐。另外，还可用它们来实现一些更高级的功能，如汇总和简化等。', '2019-01-18 10:10:25', '2019-01-18 10:10:25', 'TP3', '1', '1');
INSERT INTO `book` VALUES ('88', '经济学原理（上下）', '9787111126768', 'F05/124', '[美] 曼昆', '机械工业出版社', '', '此《经济学原理》的第3版把较多篇幅用于应用与政策，较少篇幅用于正规的经济理论。书中主要从供给与需求、企业行为与消费者选择理论、长期经济增长与短期经济波动以及宏观经济政策等角度深入浅出地剖析了经济学家们的世界观。', '2019-01-18 10:13:34', '2019-01-18 10:13:34', 'F0', '1', '1');
INSERT INTO `book` VALUES ('89', '成功大学', '9787800877544', 'B7/542', '(美)拿破仑﹒希 刘津 编', '中国发展出版社', '', '《成功大学》收集了50位大师的成功经验，从思想、行为、习惯、性格、人际关系等方面，全方位阐述了一个人获得成功所需的因素。', '2019-01-18 10:15:36', '2019-01-18 10:15:36', 'B84', '1', '1');
INSERT INTO `book` VALUES ('90', '生活中的博弈', '9787530844595', 'B82/758', '申志娟', '天津科技', '', '《生活中的博弈》用浅显易懂的语言、近百个故事讲述了博弈论的基本原理及其在现实世界的运用，使你通过快乐地学习生活中无时不在的博弈掌握竞争的技巧。让我们在遍及古今中外人文、历史、政治军事、经济、管理、心理行为等领域的故事长廊里酣畅淋漓地感受博弈的精巧和运筹帷幄的快感！', '2019-01-18 10:17:51', '2019-01-18 10:17:51', 'B82', '1', '1');
INSERT INTO `book` VALUES ('92', '资本论（第三卷）', '9787010041179', 'Z123/123', '[德] 卡尔·马克思 / [德] 卡尔·马克思', '人民出版社', '', '本卷是在《马克思恩格斯全集》中文第一版第二十四卷的基础上，根据《马克思恩格斯全集》1963年柏林版第二十四卷重新校订的。', '2019-01-18 11:03:44', '2019-01-18 11:03:44', 'A1', '1', '1');
INSERT INTO `book` VALUES ('93', '让我去那花花世界', '9787533651459', 'I5/584', '苗炜', '安徽教育出版社', '', '《让我去那花花世界》是苗炜在《三联生活周刊》“花花世界”专栏的结集。\r\n\r\n在巴黎的丁香咖啡馆，他（作者）闻到了海明威和菲茨杰拉德的余香；莫斯科的列宁墓面前，则感慨了十月革命的“伟大成就”；波兰和欧洲的交界处，他用细腻的笔触表达了对欧洲一体化进程的看法；而在人来人往的慕尼黑机场，他对吸烟室进行了煞有其事的评论……\r\n\r\n拥挤的机场、下榻的旅店、鲜有人去的街道、左岸的咖啡馆、嘈杂的酒吧……这些旅途中我们会忽略的地方，成了他发现的乐园，他用幽默的笔触表达了发现的乐趣，同时，也用感慨的态度对人生这码事进行了恰当的评价。', '2019-01-18 11:17:37', '2019-01-18 11:17:37', 'I26', '1', '1');
INSERT INTO `book` VALUES ('94', '我是猫', '9787805673103', 'I89/556', '[日] 夏目漱石', '译林出版社', '', '《我是猫》确立了夏目漱石在文学史上的地位。小说采用幽默、讽刺、滑稽的手法，借助一只猫的视觉、听觉、感觉，以主人公中学教员珍野苦沙弥的日常起居为主线，穿插了邻居资本家金田企图嫁女不成、阴谋报复苦沙弥的矛盾冲突，嘲笑了明治时代知识分子空虚的精神生活，讥讽他们自命清高，却无所事事；不满现实，却无力反抗；平庸无聊，却贬斥世俗的矛盾性格，鞭挞金田等资产阶级人物及帮凶的势利、粗鄙、凶残的本性。小说构思奇巧 ，描写夸张，结构灵活，具有鲜明的艺术特色。', '2019-01-18 11:20:41', '2019-01-18 11:20:41', 'I1', '1', '1');
INSERT INTO `book` VALUES ('95', '且在人间', '9787540488949', 'Z123/123', '余秀华', '湖南文艺出版社', '', '《且在人间》——以余秀华为生活原型，讲述一个残疾女人悲苦倔强、向死而生的故事。\r\n\r\n女主人公周玉生活在乡村，患有“脑瘫”，她几乎被所有人漠视，甚至被整个社会抛弃，但是她渴望被当成一个普通的健康人,而不是带着怜悯或不屑，她只要求平等。爱情的缺 失，家庭的不幸，生活的种种际遇让周玉用诗歌的方式把 情感抒发出来，最终她用诗歌创作出了一个文学的世界，得到了人们的认可。作者用平静的笔调书写残疾人的底层生活,将堆积在心底的黑暗与爱化作成长的养分,达到了一种真实而达观、勇敢而平静的生命境界。', '2019-03-16 15:25:10', '2019-03-16 15:25:10', 'I26', '1', '1');
INSERT INTO `book_comment` VALUES ('20', '47', '5', '这是一本投资实务领域的世界级和世纪级的经典著作，自从1949年首次出版以来，本书即成为股市上的《圣经》，本书是格雷厄姆1973年的第四版。', '2019-01-10 13:38:12');
INSERT INTO `book_comment` VALUES ('21', '75', '5', '我会将这本书带上旅途，在每个静谧陌生的夜晚拿出来慢慢看。这本书他写了很久，我希望自己能读更久。慢一些，不争一些，也许得到更多，到达更快。', '2019-01-14 17:03:40');
INSERT INTO `book_comment` VALUES ('22', '47', '5', '《聪明的投资者》告诉我们投资，更重要的是投资自己、了解自己、控制自己，甚于外部环境、外部分析师的判断。认为自己是防御型投资者，还是进攻型定投资者，本身需要自我的一个聪明的自我认知。', '2019-01-22 15:11:12');
INSERT INTO `book_comment` VALUES ('26', '65', '5', '一个玻璃杯美美地放在桌子上，当摔到地上的时候它会瞬间破碎，所以玻璃杯就是脆弱的；如果摔到地上的是一个塑料杯，它不会破碎而会在地上弹两下，所以塑料杯是强韧的；想象一下有种杯子，当摔到地下的时候，它非但没有破碎反而变成了两个杯子，这个时候它就是反脆弱的。', '2019-01-22 09:54:06');
INSERT INTO `book_comment` VALUES ('27', '65', '7', '我们似乎生在一个充满动荡的世界中：大到地震海啸次贷危机，小到夫妻吵架邻里不和，生活中总是充满了意外和不安。每个个体都好似一叶扁舟——很不幸的是，你要航行在大海中，要面对的却是不知何时会袭来的滔天巨浪。', '2019-01-22 09:56:21');
INSERT INTO `book_comment` VALUES ('28', '65', '7', '什么是反脆弱性？简单说来，似乎可以用一句话概括：打不死我的，会让我更强。', '2019-01-22 09:57:48');
INSERT INTO `book_comment` VALUES ('37', '47', '7', '简化投资行为不是我的目标。事实上，我最想表达的是投资有多么复杂。试图简化投资的人带给受众的是极大的损害。终于读完了，有机会再读。', '2019-01-23 16:00:18');
INSERT INTO `book_comment` VALUES ('39', '47', '7', '本遍阅读个人认为格雷厄姆着重描述的安全保障，应该更多强调的是安全，而安全的原因来自于保障。', '2019-01-23 16:06:32');
INSERT INTO `book_comment` VALUES ('40', '76', '5', '我们是多么容易打着“正义”的名义背叛别人', '2019-03-15 14:38:17');
INSERT INTO `book_comment` VALUES ('41', '76', '5', '也许她的眼泪是逆向地流淌，往心的方向。', '2019-03-16 15:16:59');
